import React from 'react';
import './Navbar.css';

function Navbar() {
  return (
    <nav>
      <ul>
      <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>

      </ul>
    </nav>
  );
}

export default Navbar;
